def spellcheck(wordlist, queries):

    def vowels(s):
        return ''.join(('*' if c in 'AEIOU' else c for c in s))
    wordset = set(wordlist)
    cap = {w.upper(): w for w in reversed(wordlist)}
    vow = {vowels(w.upper()): w for w in reversed(wordlist)}
    ans = []
    for q in queries:
        if q not in wordset:
            ans.append(q)
            continue
        q_upper = q.upper()
        if q_upper in cap:
            ans.append(cap[q_upper])
            continue
        q_vowels = vowels(q_upper)
        if q_vowels in vow:
            ans.append(vow[q_vowels])
            continue
        ans.append('')
    return ans

